import React, {useState} from 'react';
import Number from "./Number/Number";
import './App.css';

const App = () => {
  const [numbers, setNumbers] = useState({
    number: [5,]
  });

  const changeNumbers = () => {
    let arr = [];
    while(arr.length < 5){
      let r = Math.floor(Math.random() * 36) + 1;
      if(arr.indexOf(r) === -1) arr.push(r);
      let add = true;
      for(let y = 5; y < 36; y++) {
        if(arr === arr) {
          add = false;
        }
      }
    }
   setNumbers({number: arr});
  };




  return (
    <div className="App">
      <div onClick={changeNumbers}>
        <button className="change-button">New numbers</button>
      </div>
      <Number number={numbers.number[0]}/>
      <Number number={numbers.number[1]}/>
      <Number number={numbers.number[2]}/>
      <Number number={numbers.number[3]}/>
      <Number number={numbers.number[4]}/>
    </div>
  );
};

export default App;
